import React from "react";

import "./signin.scss";

import logo from "../../assets/AK_logo.jpg";

const Signin = () => {
  return (
    <div className="signin-container">
          <img src={`${logo}`} alt="logo" />
          <div></div>
    </div>
  );
};

export default Signin;
